import React, { useState } from 'react';
import axios from 'axios';

const CompatibilityTab = () => {
  const [person1, setPerson1] = useState({ name: '', dob: '', pob: '', tob: '' });
  const [person2, setPerson2] = useState({ name: '', dob: '', pob: '', tob: '' });
  const [compatibilityType, setCompatibilityType] = useState('amoureuse');
  const [response, setResponse] = useState('');

  const handlePersonChange = (e, person) => {
    const { name, value } = e.target;
    person === 'person1' ? setPerson1({ ...person1, [name]: value }) : setPerson2({ ...person2, [name]: value });
  };

  const handleCompatibilityTypeChange = (e) => {
    setCompatibilityType(e.target.value);
  };

  const createPrompt = (person1, person2, compatibilityType) => {
    return `Bonjour chatGPT, tu es astrologue, tu as été engagé par un client pour répondre à ses questions sur sa vie ${compatibilityType}. Voici les informations sur ton client :
            ${person1.name} né(e) le ${person1.dob} à ${person1.pob} à ${person1.tob}.

            Pour commencer, peux-tu tirer 13 cartes de tarot de marseilles au hasard et les indiquer dans ta réponse sous forme de liste ? par exemple 'voici 13 cartes de tarot de marseilles tirés au hasard : ...'.

            Voici les informations sur ${person2.name} :
            ${person2.name} né(e) le ${person2.dob} à ${person2.pob} à ${person2.tob}

            En suite, en t'aidant de l'analyse de leur thème astrale, de leur horoscope pour l'année 2023, et de l'analyse des cartes de tarot tirées peux-tu répondre à la question suivante : Est-ce que ${person1.name} et ${person2.name} sont compatibiles du point de vu ${compatibilityType} ?

            J'aimerais que tu réponde précisément et que tu donnes des exemples dans ta réponse. Finis chaque paragraphe par un conseil personnalisés, évite les phrases trop généralistes. Aussi dans l'astrologie les gens sont plus sensibles aux conseils qui portent sur leurs relations et l'humain que sur le matériel. Conclu ta réponse avec une réponse par "oui" ou par "non" pour savoir si ces deux personnes sont compatibles.
            Enlève les formules d'incertitudes, nous savons que le tarot est inexacte, pas besoin de le rappeler. Romance un peu ta réponse`;
  };

const handleSubmit = async (e) => {
  e.preventDefault();

  const prompt = createPrompt(person1, person2, compatibilityType);

  try {
    const result = await axios.post(
      `https://api.openai.com/v1/engines/text-davinci-003/completions`,
      {
        prompt,
        max_tokens: 512,
        n: 1,
        stop: null,
        temperature: 1,
      },
      {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer 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`,
        },
      }
    );

    const generatedText = result.data.choices[0].text.trim();
    const listStart =
      "Voici 13 cartes de tarot de Marseilles tirés au hasard :";
    const listEnd = ".";
    const listStartIndex = generatedText.indexOf(listStart);
    const listEndIndex = generatedText.indexOf(listEnd, listStartIndex);
    let listItems = [];

    if (listStartIndex >= 0 && listEndIndex > listStartIndex) {
      const listString = generatedText.slice(
        listStartIndex + listStart.length,
        listEndIndex
      );
      listItems = listString.split(",").map((item) => item.trim());
    }

    const paragraphs = generatedText
      .split("\n")
      .filter((paragraph, index) => index !== listStartIndex);

    setResponse({ paragraphs, listItems });
  } catch (error) {
    console.error("Error fetching data from OpenAI API:", error);
    setResponse("An error occurred. Please try again.");
  }
};

  return (
    <div className="compatibility-tab">
      {/* Inputs for Person 1 */}
      <h3>Personne 1</h3>
      <label>
        Prénom :
        <input type="text" name="name" value={person1.name} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>
      <label>
        Date de naissance :
        <input type="date" name="dob" value={person1.dob} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>
      <label>
        Lieu de naissance :
        <input type="text" name="pob" value={person1.pob} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>
      <label>
        Heure de naissance :
        <input type="time" name="tob" value={person1.tob} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>

      {/* Inputs for Person 2 */}
      <h3>Personne 2</h3>
      <label>
        Prénom :
        <input type="text" name="name" value={person2.name} onChange={(e) => handlePersonChange(e, 'person2')} />
      </label>
      <label>
      Date de naissance :
      <input type="date" name="dob" value={person2.dob} onChange={(e) => handlePersonChange(e, 'person2')} />
    </label>
    <label>
      Lieu de naissance :
      <input type="text" name="pob" value={person2.pob} onChange={(e) => handlePersonChange(e, 'person2')} />
    </label>
    <label>
      Heure de naissance :
      <input type="time" name="tob" value={person2.tob} onChange={(e) => handlePersonChange(e, 'person2')} />
    </label>

    {/* Radio buttons for compatibility type */}
    <label>
      <input
        type="radio"
        value="amoureuse"
        checked={compatibilityType === "amoureuse"}
        onChange={handleCompatibilityTypeChange}
      />
      Amoureuse
    </label>
    <label>
      <input
        type="radio"
        value="professionnelle"
        checked={compatibilityType === "professionnelle"}
        onChange={handleCompatibilityTypeChange}
      />
      Professionnelle
    </label>
    <label>
      <input
        type="radio"
        value="amicale"
        checked={compatibilityType === "amicale"}
        onChange={handleCompatibilityTypeChange}
      />
      Amicale
    </label>

    {/* Submit button */}
    <button onClick={handleSubmit}>Calculer la compatibilité</button>

    {/* Display the response */}
    <div className="compatibility-response">
      <h3>Résultat de la compatibilité :</h3>
      <p>{response}</p>
    </div>
  </div>
  );
};

export default CompatibilityTab;
